class Solution:
    def find_word(self, l: int, w: int) -> str:
        letter_weights = [1] * 26
        for _ in range(l):
            word = input().strip().split()
            if len(word)!= l:
                return "impossible"
            for letter in word:
                if letter.isupper() and letter in letter_weights:
                    letter_weights.remove(letter)
        result = ""
        for weight in letter_weights:
            for i in range(w - weight):
                result += chr(ord('a') + i)
        return result

